var isValid = function(s) {
    const stack = []; // Stack to keep track of opening brackets
    const bracketMap = { '(': ')', '{': '}', '[': ']' }; // Map for matching brackets

    for (let char of s) {
        if (bracketMap[char]) {
            // If the character is an opening bracket, push it onto the stack
            stack.push(char);
        } else {
            // If the character is a closing bracket
            if (stack.length === 0 || bracketMap[stack.pop()] !== char) {
                // If the stack is empty or the top of the stack does not match the closing bracket
                return false;
            }
        }
    }

    // If the stack is empty, all brackets were matched correctly
    return stack.length === 0;
};

class Solution {
    public boolean isValid(String s) {
        // Stack to keep track of opening brackets
        Stack<Character> stack = new Stack<>();

        // Map to hold matching pairs of brackets
        Map<Character, Character> bracketMap = new HashMap<>();
        bracketMap.put(')', '(');
        bracketMap.put('}', '{');
        bracketMap.put(']', '[');

        // Iterate through each character in the string
        for (char c : s.toCharArray()) {
            // If it's a closing bracket
            if (bracketMap.containsKey(c)) {
                // Check if the stack is empty or the top of the stack doesn't match
                if (stack.isEmpty() || stack.pop() != bracketMap.get(c)) {
                    return false; // Invalid case
                }
            } else {
                // If it's an opening bracket, push it onto the stack
                stack.push(c);
            }
        }

        // If the stack is empty, all brackets were matched correctly
        return stack.isEmpty();
    }
}

